import { FiSearch } from "react-icons/fi";
import { RiMenu5Fill } from "react-icons/ri";

import Button from "./UI/Button";
import { useState } from "react";

function NavBar() {
	const [open, setIsopen] = useState(false);

	const openMenu = () => {
		alert('Clicked!')
		setIsopen(!open);
	}

	return (
		<div className="flex justify-between shadow-md border-black py-1 px-16 items-center">
			<div className="border">
				<img src="/static/images/BlogPost4.png"  alt="Blog Post" className="w-8" />
			</div>
			<div className="hidden md:visible md:flex justify-between items-center w-72">
				<h1>Blog</h1>
				<h1>About</h1>
				<FiSearch size={24} className="cursor-pointer" />
				<Button text={'Contact Us'} />
			</div>
			<div className="md:hidden">
          <button onClick={openMenu} className="focus:outline-none">
            <svg
              className="w-6 h-6"
              fill="none"
              stroke="currentColor"
              viewBox="0 0 24 24"
              xmlns="http://www.w3.org/2000/svg"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth="2"
                d="M4 6h16M4 12h16M4 18h16"
              ></path>
            </svg>
          </button>
        </div>
		</div>
	)
}

export default NavBar;
